import React,{useEffect} from 'react';
import './App.css';
import {requestToAPI} from './containers/API'



function App() {

  useEffect(()=>{
    requestToAPI().then((result)=>{
      console.log(result.data);
    })
  });

  return (
    <div className="App">
      <header className="App-header">
      </header>
    </div>
  );
}

export default App;
